import React from 'react';
import { 
  Database, 
  Server, 
  Cloud,
  HardDrive,
  Network,
  Shield,
  AlertCircle,
  CheckCircle
} from 'lucide-react';

const Resources = () => {
  const resources = {
    databases: [
      {
        name: 'Production DB',
        type: 'postgresql',
        status: 'healthy',
        owner: 'team-db',
        specs: { cpu: '4 vCPU', memory: '16GB', storage: '500GB' }
      },
      {
        name: 'Analytics DB',
        type: 'clickhouse',
        status: 'warning',
        owner: 'team-analytics',
        specs: { cpu: '8 vCPU', memory: '32GB', storage: '1TB' }
      }
    ],
    storage: [
      {
        name: 'User Content',
        type: 'object-storage',
        status: 'healthy',
        owner: 'team-content',
        specs: { capacity: '5TB', used: '3.2TB' }
      }
    ],
    compute: [
      {
        name: 'API Cluster',
        type: 'kubernetes',
        status: 'healthy',
        owner: 'team-platform',
        specs: { nodes: 5, version: '1.25' }
      }
    ],
    network: [
      {
        name: 'Main VPC',
        type: 'vpc',
        status: 'healthy',
        owner: 'team-network',
        specs: { cidr: '10.0.0.0/16', regions: ['us-east-1', 'eu-west-1'] }
      }
    ]
  };

  return (
    <div className="min-h-screen bg-gray-50 p-8">
      <header className="max-w-7xl mx-auto mb-8">
        <h1 className="text-2xl font-bold text-gray-900">Resources</h1>
        <p className="mt-2 text-gray-600">Manage and monitor your infrastructure resources</p>
      </header>

      <div className="max-w-7xl mx-auto">
        {/* Resource Type Overview */}
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
          {[
            { title: 'Databases', count: resources.databases.length, icon: Database, color: 'blue' },
            { title: 'Storage', count: resources.storage.length, icon: HardDrive, color: 'green' },
            { title: 'Compute', count: resources.compute.length, icon: Server, color: 'purple' },
            { title: 'Network', count: resources.network.length, icon: Network, color: 'orange' },
          ].map((item, index) => (
            <div key={index} className="bg-white rounded-lg shadow p-6">
              <div className="flex items-center space-x-4">
                <div className={`p-3 bg-${item.color}-100 rounded-lg`}>
                  <item.icon className={`h-6 w-6 text-${item.color}-600`} />
                </div>
                <div>
                  <p className="text-sm font-medium text-gray-600">{item.title}</p>
                  <p className="text-2xl font-semibold text-gray-900">{item.count}</p>
                </div>
              </div>
            </div>
          ))}
        </div>

        {/* Resource Listings */}
        {Object.entries(resources).map(([category, items]) => (
          <div key={category} className="bg-white rounded-lg shadow mb-6">
            <div className="px-6 py-4 border-b border-gray-200">
              <h2 className="text-lg font-medium text-gray-900 capitalize">{category}</h2>
            </div>
            <div className="divide-y divide-gray-200">
              {items.map((resource, index) => (
                <div key={index} className="px-6 py-4">
                  <div className="flex items-center justify-between">
                    <div>
                      <div className="flex items-center space-x-2">
                        <h3 className="text-sm font-medium text-gray-900">{resource.name}</h3>
                        {resource.status === 'healthy' ? (
                          <CheckCircle className="h-4 w-4 text-green-500" />
                        ) : (
                          <AlertCircle className="h-4 w-4 text-yellow-500" />
                        )}
                      </div>
                      <p className="text-sm text-gray-500">Type: {resource.type}</p>
                      <p className="text-sm text-gray-500">Owner: {resource.owner}</p>
                    </div>
                    <div className="text-right">
                      {Object.entries(resource.specs).map(([key, value]) => (
                        <p key={key} className="text-sm text-gray-600">
                          <span className="font-medium capitalize">{key}:</span> {value}
                        </p>
                      ))}
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        ))}

        {/* Security Notice */}
        <div className="bg-blue-50 border border-blue-200 rounded-lg p-4 flex items-start space-x-3">
          <Shield className="h-5 w-5 text-blue-500 mt-0.5" />
          <div>
            <h3 className="text-sm font-medium text-blue-800">Security Notice</h3>
            <p className="mt-1 text-sm text-blue-600">
              All resources are protected by encryption at rest and in transit. Access is logged and monitored.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Resources;
